			dojo.declare("fish", null, {
                                constructor: function(picbox){
                                        var self = this;
					this.picbox = picbox;
					self.alive = true;
					self.caught = false;
					self.topped = false;
					self.dir = Math.round(Math.random());
					self.sinMod = Math.random() * 2 * Math.PI;
					self.yModMod = Math.random() * .5;
					self.x = this.picbox.x + self.dir * this.picbox.w;
					self.xMod = (-2.0 * self.dir + 1) * Math.random() * 2;
					self.y = this.picbox.y + (200 + Math.random() * (this.picbox.h - 140));
					self.color = this.picbox.fishColors[Math.round(Math.random() * 6)];
					self.pic = this.picbox.r.path(this.picbox.fishPaths[Math.round(Math.random() * 0)]);
					this.picbox.el.push(self.pic);
					self.pic.scale(-.4 * self.dir + .2, .2);
                                        self.draw();
					this.picbox.numFish++;
                                        console.log(self);
					setInterval(dojo.hitch(this,self.update), 15);
                                },
                                draw: function(){
                                        var self = this;
					self.pic.attr({"fill": self.color})
					self.pic.translate(self.x, self.y);
                                },
				update: function(){
					var self = this;
					if(self.alive){
					  var yMod = 0;
					  if(self.caught){
					    if(!this.picbox.hook.topped && !self.topped){
					      yMod = self.yModMod;
					      self.y += yMod;
					    }
					    else{
					      self.topped = true;
					    }
					  }
					  else if(self.y > 300){
					    yMod = self.yModMod * Math.sin(self.sinMod + self.x * Math.PI / 180);
					    self.y += yMod;
					  }
					  if(self.x < this.picbox.x - 10 || self.x > this.picbox.x + this.picbox.w + 10){
					    self.alive = false;
					  }
					  else{
					    self.x += self.xMod;
					    self.pic.translate(self.xMod, yMod);
					  }
					}
				}
			});

